    const formHandler = (event) => {
        event.preventDefault();
        console.log(event.target.elements);
    }

    return (
        <div>
            <form onSubmit={formHandler}>
                <div>
                    <input type="text" name='id' defaultValue='28hu79' />
                </div>
                <div>
                    <input type="text" name='title' defaultValue='Стиральная машина Whirlpool AWE60410' />
                </div>
                <div>
                    <input type="text" name='image' defaultValue='https://content2.rozetka.com.ua/goods/images/big_tile/180756189.jpg' />
                </div>
                <button type="submit">Add new goods</button>
                </form>
        </div>
    );
}

export default Goods;
